const Grid = () => {
  const fetchData = async () => {
    const { data } = await axios.get(
      `${process.env.REACT_APP_SERVER_URL}/item/all`
    )

    setItems(data.data)
  }
  const [selectedCategory, setSelectedCategory] = useState('All')
  const [items, setItems] = useState([])

  useEffect(() => {
    fetchData()
  }, [])

  const filteredData =
    selectedCategory === 'All'
      ? items
      : items.filter((item) => item.category === selectedCategory)
  const handleAddQuantity = (index) => {
    const newItems = [...items]
    newItems[index].quantity += 1
    setItems(newItems)
  }

  const handleRemoveQuantity = (index) => {
    const newItems = [...items]
    newItems[index].quantity = Math.max(0, newItems[index].quantity - 1)
    setItems(newItems)
  }

  const handleRemoveItem = (index) => {
    const newItems = [...items]
    newItems.splice(index, 1)
    setItems(newItems)
  }

  const handleChangePrice = (index, newPrice) => {
    const newItems = [...items]
    newItems[index].price = newPrice
    setItems(newItems)
  }

  if (!items) {
    return (
      <div>
        <h1>Loading....</h1>
      </div>
    )
  }
  return (
    <div>
      <button
        onClick={() => setSelectedCategory('All')}
        style={{
          backgroundColor: selectedCategory === 'All' ? '#6c757d' : '#007BFF',
        }}
      >
        All
      </button>
      <button
        onClick={() => setSelectedCategory('Fruits')}
        style={{
          backgroundColor:
            selectedCategory === 'Fruits' ? '#6c757d' : '#007BFF',
        }}
      >
        Fruits
      </button>
      <button
        onClick={() => setSelectedCategory('Bakery')}
        style={{
          backgroundColor:
            selectedCategory === 'Bakery' ? '#6c757d' : '#007BFF',
        }}
      >
        Bakery
      </button>
      <button
        onClick={() => setSelectedCategory('Dairy')}
        style={{
          backgroundColor: selectedCategory === 'Dairy' ? '#6c757d' : '#007BFF',
        }}
      >
        Dairy
      </button>
      <div className='grid'>
        {filteredData.map((item, index) => {
          if (
            selectedCategory !== 'All' &&
            item.category !== selectedCategory
          ) {
            return null
          }
          return (
            <div key={index} className='grid-item'>
              <img src={item.image_link} alt={item.name} />
              <h2>{item.name}</h2>
              <p>
                <strong>Description:</strong> {item.description}
              </p>
              <p>
                <strong>Category:</strong> {item.category}
              </p>
              <p>
                <strong>Price:</strong> {item.price} $
              </p>
              <p>
                <strong>GST:</strong> {item.gst * 100} %
              </p>
              <p>
                <strong>Discount:</strong> {item.discount * 100} %
              </p>
              <p>
                <strong>Total Price:</strong> {item.total_price} $
              </p>
              <p>
                <strong>Quantity Left:</strong> {item.quantity}
              </p>
              <button onClick={() => handleAddQuantity(index)}>
                Add one quantity
              </button>
              <button onClick={() => handleRemoveQuantity(index)}>
                Remove one quantity
              </button>
              <button onClick={() => handleRemoveItem(index)}>
                Remove this item
              </button>
              <button
                onClick={() =>
                  handleChangePrice(index, prompt('Enter new price'))
                }
              >
                Change Price
              </button>
            </div>
          )
        })}
      </div>
    </div>
  )
}

export default Grid
